INSERT INTO `faq` (`faq_id`, `question`, `answer`) VALUES
(5, 'What is  this?', '<table class=help_tr  border=0 cellpadding=7 width=730 cellspacing=0>\r\n <tr><td><font color=blue><b>What is ?</b></font></td></tr></table>\r\n<table class=help_content border=0 cellpadding=10 cellspacing=0>\r\n<tr>\r\n <td>\r\n<p> is the world''s online marketplace - a place for buyers and sellers to come together and trade almost anything!</p>\r\n\r\n  <h3>Heres how it works:</h3>     \r\n\r\n<ul>\r\n  <li> A seller lists an item on  - from antiques to cars, books to sporting goods.The seller chooses to accept only bids for the item (an online auction) or to offer the Buy It Now option, which allows buyers to purchase the item right away.</li>\r\n</ul> \r\n<ul><li>In an online auction, the bidding opens at a price the seller specifies and remains on  for a certain number of days.Buyers then place bids on the item.When the listing ends, the buyer with the highest bid wins!</li></ul> \r\n<ul><li>In fixed price listings that offer Buy It Now, the first buyer willing to pay the sellers price gets the item. </li></ul>\r\n</td></tr>\r\n</table>\r\n'),
(8, 'What is paypal  ?', '<table class=help_tr  border=0 cellpadding=7 width=730 cellspacing=0>\r\n <tr><td><font color=blue><b>What is PayPal?</b></font></td></tr></table>\r\n<table class=help_content border=0 cellpadding=10 cellspacing=0>\r\n<tr>\r\n<td>\r\nPayPal is  preferred way to pay. It is a system that lets anyone with an email address securely send and receive online payments using their credit card or bank account.  members can use PayPal to quickly and easily pay for items on .\r\n\r\n</td></tr></table>\r\n'),
(14, 'Registration', '<table class=help_tr border=0  cellpadding=7 width=730 cellspacing=0>\r\n <tr> <td><font color=blue><b>Registering to Buy </b></font>\r\n </td></tr></table>\r\n<table class=help_content  border=0 cellpadding=10 cellspacing=0>\r\n<tr>\r\n <td>\r\nYou only have to register once. Just follow these three steps: \r\n\r\n<ol><li>When you register at , you''ll be asked to provide your basic contact information. <b>Your information will be kept private </b>on  secure servers.</li>\r\n\r\n<br><br><li>Check your email- will send you a message with a link and instructions for confirming your registration.</li>\r\n\r\n<br><br><li>For security purposes, you''ll choose your own User ID and password for signing in to . </li></ol></td></tr></table>'),
(15, 'How to buy an item', '<table class=help_tr  border=0 cellpadding=7 width=730 cellspacing=0>\r\n <tr><td><font color=blue><b>How to Buy an item?<b></font></td></tr></table>\r\n<table class=help_content  border=0 cellpadding=10 cellspacing=0>\r\n<tr>\r\n<td>\r\nBuying on  is easy - and fun! You can \r\nfind almost anything for sale - from new computers to  antiques and collectibles. <br><br>\r\n\r\n<b>Here are a few basic steps to get you started:</b><br/>\r\n<ol><li><b>Find an item.</b><br/>\r\nSearch by typing in a keyword for an item you''re interested in, or browse through our categories.</li><br><br>\r\n\r\n<li><b>Learn about the item you found.</b><br/>\r\nRead the item description carefully, and look at the pictures the seller has included. If you have any questions about the item that aren''t answered in the item''s description, you can ask the seller about the item by clicking on the ''Ask Seller a Question'' link. Carefully reading all the information and asking informed questions will help you determine if this is the item you want!</li><br><br>\r\n\r\n<li><b>Review the seller''s feedback.</b><br/>\r\nYou can see the seller''s feedback score and percentage of positive feedback right on the item page. Also, be sure and read the comments left by the seller''s previous buyers to be sure that this is a seller you feel you can trust.</li><br><br>\r\n\r\n<li><b>Bid or Buy It Now.</b><br/>\r\nOnce you''ve found the item you want, you can place a bid or purchase the item instantly using Buy It Now. Some items are sold only in auction-style listings that require you to place a bid, while others include the Buy It Now option. This allows you to buy the item instantly. Check the item page to see what purchase options are available to you.</li><br><br>\r\n\r\n<li><b>Pay for the item.</b><br/>\r\nAfter you''ve won or purchased the item, send your payment to the seller. If the seller offers PayPal, clicking on the Pay Now button will allow you to pay quickly and easily with PayPal,  preferred way to pay. Just check the seller''s listing or email invoice to find out what the preferred payment method is and where you should send your payment.</li><br><br>\r\n\r\n<li><b>Leave feedback.</b><br/>\r\nHere''s your chance to tell the  community about your experience with this seller. You can leave feedback for any  member you''ve bought from or sold to.</li><br/></td></tr></table>\r\n \r\n'),
(16, 'How to sell an item?', '<table class=help_tr  border=0 cellpadding=7 width=730 cellspacing=0>\r\n <tr><td><font color=blue><b>How to Sell an item?</b></font></td></tr></table>\r\n<table class=help_content  border=0 cellpadding=10 cellspacing=0>\r\n<tr>\r\n<td>\r\n\r\n<p>Selling items on  is a great way to make some extra money - and have fun doing it! You can sell a few items that you no longer need, or build your own business.</p>\r\n\r\n<b>Here are the basics of listing items for sale:</b><br>\r\n<ol><li><b>Find an item you want to sell.</b><br>\r\nDo some research on  to get an idea of your item''s potential value and best category placement. Search for items similar to yours to find out what other seller''s starting prices and categories were.</li><br><br>\r\n\r\n<li><b>List your item.</b><br>\r\nClick Sell in the navigation bar at the top of any  page.  Sell Your Item form will take you through the process of listing your item step-by-step, including helping you find the correct category for your item.</li><br><br>\r\n\r\n<li><b>Set your price.</b><br>\r\nYou can set a starting price and allow buyers to place bids, offer a fixed price you''ll accept using Buy It Now, or both.</li><br><br>\r\n\r\n<li><b>Get paid!</b><br>\r\nWhen your listing ends, contact your winning buyer through email or by generating an  invoice within three business days. Let your buyer know the total price of the item, including your stated shipping costs, and how they can pay you. Offering PayPal allows your buyer to pay you quickly and easily.</li><br><br>\r\n\r\n<li><b>Ship the item.</b><br>\r\nAfter payment is received, send the item to the buyer''s shipping address, specified with their payment or by email.</li><br><br>\r\n\r\n<li><b>Leave feedback.</b><br>\r\nAfter your successful sale, leave feedback for your buyer, and ask that they do the same.</li><br><br></td></tr></table>\r\n \r\n');
