INSERT INTO `mail_subjects` (`mail_id`, `mail_title`, `mail_from`, `mail_subject`, `mail_message`) VALUES
(1, 'welcome mail', 'elton.musica@hotmail.com', 'Bem vindo ao Mercado Líder', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <username>,<br>\r\nThank you for choosing us.<br>\r\nPlease Note :<br>\r\nYour Registration Process is not completed yet<a href=<url?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>/verify.php?userid=<userid>> :\r\nClick here to Confirm your Registration.</a> <br>\r\nYour Username is :<username> <br>\r\nYour Password is :<password> <br>\r\nYour Verfication Code is : <vcode> <br>\r\nRegards \r\nAdmin.\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr></table>'),
(5, 'A  Wining mail for an Item', 'antonyprabhu@ajsquare.com', 'You have won an Auction', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear NAME, <br><br>\r\nCongratulations! You have won the following item:<br>\r\n<br>\r\n\r\nItem Title: <a href=''<GET_VIEW_ITEM?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>''><ITEM_TITLE></a><br>\r\nItem Price:<cur><SALE_PRICE><br>\r\nQuantity:<QUANTITY><br>\r\nShipping Cost:<SHIPPING_COST><br>\r\nTax: <SALE_TAX>\r\n\r\nTo view the auction please visit <a href= ''<GET_VIEW_ITEM?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>''>click here</a>.<br> <br>\r\n\r\nTo pay for the item:<br>\r\n\r\n1. Log into your account <br>\r\n\r\n2. Got to My Auction<br>\r\n\r\n3. Under the header All Buying click on Won<br>\r\n\r\n4. You will see all items that you won, click on Pay Now to see the sellers preferred payment methods.<p>\r\n\r\n\r\n\r\nThank you,<br><br>\r\n<sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(3, 'ask question to a seller', '<buyer_email_id>', '<?php echo    ?>', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <seller_name>,<br>\r\n<buyer_name> has ask this question regarding your product (<product_name> ).<br> \r\n<question> \r\n<br>Best Regards,<br>\r\n<sitename>\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(2, 'email to  friend mail', 'antonyprabhu@ajsquare.com', '<?php echo    ?>', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr bgcolor=#EEEEF8><td>\r\n<b><font size=2><username> Sent You This <?php echo    ?>\r\n Item.</font></b>\r\n</td></tr>\r\n<tr><td><b>Personal Message:</b><msg></td></tr>\r\n<tr><td>\r\n<a href=<page?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>>Click Here to View this Item.</a></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(6, 'Winner mail to seller', 'antonyprabhu@ajsquare.com', 'Winner''s Announcement', '<table>\r\n<tr>\r\n<td> Dear <sellername>,\r\n</td></tr>\r\n<tr><td>\r\n<winner_name> has bidded for the following <item_name>(<item_no>) Item. </td></tr>\r\n<tr><td>\r\nNow the User has won the Item for the <amount> price.\r\n</td></tr>\r\n<tr><td>Winner Email Id:<winneremail></td></tr>\r\n<tr><td>Regards,<br>\r\n<sitename></td></tr></table>'),
(8, 'mail to seller', 'antonyprabhu@ajsquare.com', 'A Buyer bought Your Item', '<table cellpadding=5 cellspacing=2 width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr bgcolor=#EEEEF8><td align=center >Fixed Sale Announcement</td></tr>\r\n\r\n<tr><td> Dear <sellername>,</td></tr>\r\n\r\n<tr><td>Your Selling Item <b><itemname></b> (Id:<itemid>) is brought in Fixed Sale Method  </td></tr>\r\n\r\n<tr><td><table width=600>\r\n<Buyer Details>\r\n</table></td></tr>\r\n<tr><td>Regards,<br>\r\n<sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>\r\n'),
(9, 'mail to seller(reserve price met)', 'antonyprabhu@ajsquare.com', 'Reserve Price Met', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr bgcolor=#EEEEF8><td align=center>Reserve Price Has Been Met</td></tr>\r\n<tr><td> Dear <sellername>,</td></tr>\r\n<tr><td>Your Selling Item <b><itemname></b> (Id:<itemid>) has met the reserve price.</td></tr>\r\n<tr><td>\r\n<table width=80%>\r\n<tr><td>Item Id  </td><td>ITEM_ID</td></tr>\r\n<tr><td>Item Title </td><td>ITEM_TITLE </td></tr>\r\n<tr><td>Bidding Price </td><td>SALE_PRICE </td></tr>\r\n<tr><td>Reserve Price </td><td>RESERVE_PRICE </td></tr>\r\n</table></td></tr>\r\n<tr><td>Regards,<br>\r\n<sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(11, 'mail to buyer(Reserve Price Has not been Met )', 'antonyprabhu@ajsquare.com', 'Reserve Price Has not been Met', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <username>,<br><br>\r\nReserve Price Has not been Met for this <itemname>(# <itemid>) which you had bidded.<br><br>So the item is closed without selling to any bidder.<br><br>\r\nThank You<br>\r\nAdmin\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(12, 'No Bid Placed for Your Auction', 'eddy@corette.name', 'Your Auction Closed', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <username>,<br><br>\r\nAuction <item_name>(# <itemid>) did not sell.  Feel free to relist your auction.<br><br>\r\nThank You<br>\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(13, 'mail to seller(Reserve Price Has not been Met )', 'admin@testdomain.com', 'Reserve Price Has not been Met(Item Closed)', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>      \r\nDear <username><br><br>This item is closed without selling since reserve Price Has not been Met for this <itemname>(# <itemid>). Feel free to relist your auction.<br><br>Thank You<br>\r\nAdmin</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(14, 'Out Bids Remainder', 'antonyprabhu@ajsquare.com', 'Another user placed a bid', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>Dear <user>,</td></tr>\r\n<tr><td>Your opponant user has bidded more than yours for the item id #<item_id>.so proceed your bid further.</td></tr><tr><td>Regards,<br> <sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(16, 'Unpaid Item Remainder (mail to buyer)', 'antonyprabhu@ajsquare.com', 'Your Auction Account Has Been Placed On-hold : Action Required', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <buyer>,<br>\r\n<msg> as send unpaid item remiander for item #  (<item_no>) .<br>Your account has been restricted and you will not be able to bid, buy or list on auction site. To avoid further retrictions please pay your fees today by following these steps....<br>\r\n step1.<br>\r\n step2.\r\n<br>\r\nIf you have already paid your eBay fees, please disregard this message. \r\n<br>\r\n<br>\r\nThank you, <br>\r\nAdmin</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(17, 'Warning mail to seller to deliever item', 'antonyprabhu@ajsquare.com', 'Your Auction Account Has Been Placed On-hold : Action Required', 'Dear <Seller>,<br>\r\nYou are late in delievering an item#(<item_no>) that was sold on <site>. <br>Your account has been restricted and you will not be able to bid, buy or list on auction site.To avoid further restrictions please deliever the item today.\r\n<br>\r\n<br>\r\nIf you have already delivered the item, please disregard this message. \r\n<br>\r\n<br>\r\n\r\nThank you, <br>\r\n<admin>\r\n'),
(18, 'Mail to seller', 'antonyprabhu@ajsquare.com', 'Your Auction Closed', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC;\r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>Dear NAME, <br><br>\r\nCongratulations! You Auction Closed Successfully:<br>\r\n<br></td></tr>\r\n<tr><td>\r\n\r\nItem Title: <a href=''<GET_VIEW_ITEM?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>''><ITEM_TITLE></a><br><br>\r\n</td></tr>\r\n<tr><td><table width=600>\r\n<Buyer Details>\r\n</table></td></tr>\r\n<tr><td>\r\nTo view the sellers detail and get information about this auction please <a href= \r\n''<GET_VIEW_ITEM?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>''>click here</a>.<br><br>\r\n</td></tr>\r\n<tr><td>\r\nRegards<br><br>\r\n<sitename>\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(15, 'Listing Confirmation mail', 'antonyprabhu@ajsquare.com', 'Your Listing in <site>', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; \r\nborder-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <seller>,<br>\r\n<b>The following auction has been posted on <site>: </b><br><br>\r\nAuction Name: <b><auction_name></b><br>\r\nAuction Type: <b><auction_type></b><br>\r\nQuantity Offered: <b><quantity></b><br>\r\nCategory: <b><category></b><br> \r\nStarting Bid: <b><bid></b><br>\r\nBuy Now Option: <b>Available</b><br> \r\nReserve Price: <b><reserve></b><br>\r\nClosing Date: <b><closingdate></b><br>\r\n<a href=<site?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>/detail.php?item_id=<item_id>>Click to view the auction </a><br><br>\r\n\r\nThank you for your submission. <br>\r\n<b>The <site> staff </b></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(20, 'Last Login Ip', 'antonyprabhu@ajsquare.com', 'Last Login Ip', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear Admin,<br>\r\n<site> Admin panel''s last login IP address is below.<br>Ip Address:<b><ip></b><br>\r\nBest Regards.\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(24, 'Notification mail to admin for refund', 'antonyprabhu@ajsquare.com', 'refund for final sale value fee', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr bgcolor=#EEEEF8><td><strong>A Seller Closed his dispute </strong></td></tr>\r\n<tr ><td>Dear Admin,\r\n</td></tr>\r\n<tr><td>The buyer <buyer> didn''''t pay for the item <itemtitle> number <number> for seller <seller>.Please refund the final sale value fee of <amount> <currency>.\r\n</td></tr>\r\n<tr><td>Thank You,\r\n</td></tr>\r\n<tr><td><sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(25, 'Confirmation mail to seller for open dispute', 'antonyprabhu@ajsquare.com', 'You have opened a dispute', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <seller>,<br>\r\n You have opened a dispute to <buyer> of the following item:<br>\r\n<a href=<sitename?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>/detail.php?item_id=<number>><title1></a><number>\r\n<br>\r\nRegards,<br>\r\n<sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(27, 'Dispute reply message mail', 'antonyprabhu@ajsquare.com', 'reply for dispute number <disputeid>', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <user>,<br>\r\nThe other party reply a new message in your dispute console about item <a href=<site?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>/detail.php?item_id=<number>><title1></a> <number><br>\r\nRegards,<br>\r\n<site></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(28, 'Mail for Close Dispute', 'antonyprabhu@ajsquare.com', 'dispute has been closed', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\n<tr><td>\r\nDear <user>,<br>\r\n The other party close the dispute for the item <a href=<site?phpMyAdmin=nes5pawYnzuxJCz5aaTIGPrzdu1>/detail.php?item_id=<number>><title1></a> <number>.<br>\r\nRegards,<br>\r\n<site></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(29, 'Dispute intimation mail to seller', 'admin@admin.com', 'Dispute intimation mail to seller', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr>\r\nDear Admin,<br> A dispute has been araised by <name> for the item(#<itemid>).Login into dispute section for further details.<br> Regards,<br> <site>.\r\n</td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
(23, 'Notification mail to admin for item not received b', 'admin@admin.com', 'closing dispute', '<table width=700 style="border-left:1px solid #CCCCCC;border-top:1px solid #CCCCCC; border-right:1px solid #cccccc; border-bottom:1px solid #cccccc">\r\n<tr><td><img src=''<imgh>''></td></tr><tr bgcolor=#EEEEF8><td><strong>A Buyer Closed his dispute </strong></td></tr><tr><td>Dear Admin,</td></tr><tr><td>The seller <seller> didn''t send the item <itemtitle> number <number> to buyer <buyer>.</td></tr><tr><td>Thank You,</td></tr><tr><td><sitename></td></tr>\r\n<tr><td><img src=''<imgf>''></td></tr>\r\n</table>'),
