(11342, 180, 12, 0, 'Computador Apple ', '', '1', 1, '1', '<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 4px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(51, 51, 51); font-family: ''Lucida Grande'', ''Lucida Sans Unicode'', Helvetica, Arial, Verdana, sans-serif; font-size: 12px; line-height: 18px; ">Todos os produtos AppleCare entram em vigor a partir da data de aquisi&ccedil;&atilde;o do produto de hardware. Para tirar o m&aacute;ximo partido de todos os benef&iacute;cios AppleCare, registe hoje o seu contrato AppleCare.</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(51, 51, 51); font-family: ''Lucida Grande'', ''Lucida Sans Unicode'', Helvetica, Arial, Verdana, sans-serif; font-size: 12px; line-height: 18px; "><a href="https://selfsolve.apple.com/Agreements.do" style="color: rgb(0, 136, 204); text-decoration: none; ">Registar um novo contrato</a>&nbsp;<span class="sidebar" style="font-size: 10px; line-height: 18px; color: rgb(51, 51, 51); ">(requer in&iacute;cio de sess&atilde;o com o Apple ID)</span><br /><a href="https://selfsolve.apple.com/Agreements.do" style="color: rgb(0, 136, 204); text-decoration: none; ">Verificar o estado do registo</a>&nbsp;<span class="sidebar" style="font-size: 10px; line-height: 18px; color: rgb(51, 51, 51); ">(requer in&iacute;cio de sess&atilde;o com o Apple ID)</span></p>\r\n<p class="sidebar" style="margin-top: 0px; margin-right: 0px; margin-bottom: 8px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 10px; line-height: 18px; color: rgb(51, 51, 51); font-family: ''Lucida Grande'', ''Lucida Sans Unicode'', Helvetica, Arial, Verdana, sans-serif; ">Tenha &agrave; m&atilde;o o seu n&uacute;mero de registo AppleCare e quaisquer n&uacute;meros de s&eacute;rie do hardware antes de iniciar o registo do contrato.</p>\r\n<p class="sidebar" style="margin-top: 0px; margin-right: 0px; margin-bottom: 8px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 10px; line-height: 18px; color: rgb(51, 51, 51); font-family: ''Lucida Grande'', ''Lucida Sans Unicode'', Helvetica, Arial, Verdana, sans-serif; ">&eacute; necess&aacute;rio registar o seu contrato antes da expira&ccedil;&atilde;o da garantia limitada padr&atilde;o do produto de hardware (geralmente ap&oacute;s um ano a partir da data de compra).</p>\r\n\r\n<style type="text/css">\r\nbody {\r\n	background: #FFF;\r\n}\r\n</style>\r\n\r\n', 'New', 'fix', 0.00, 5, 20.00, 'Inclusive', ' 1,2,3', 10, 'R$', 0.00, 930.00, '2010-11-29 15:31:26', 3, 'Active', '2010-11-26_677e0_001.jpg', '2010-11-26_d18f6_002.jpg', '2010-11-26_60815_003.jpg', '', '', '', '', '1', 0, 23, '2010-12-09 15:31:26', 'elton.musica@hotmail.com', '', 0.00, 20, 0.00, '', '', 0, '', ' ', '', 'Yes', '', 'layout_standard.gif', '', 'unpaid', 930.00, '', '');
